import React from "react";
import "./SectionTen.css";
// import ArrowForwardIcon from "@mui/icons-material/ArrowForward";
// import secImage from "./SectionTenImg.avif";
import Slider from "react-slick";
import ArrowForwardIcon from "@mui/icons-material/ArrowForward";
import ArrowBackIcon from "@mui/icons-material/ArrowBack";

function SampleNextArrow(props) {
  const { className, style, onClick } = props;
  return (
    <div
      style={{
        ...style,
        top: "40%",
        right: "-15px",
        zIndex: "2",
        backgroundColor: "#fff",
        height: "32px",
        border: "2px solid #e1e1e1",
        cursor: "pointer",
        padding: "2px",
        borderRadius: "50%",
        position: "absolute",
      }}
      onClick={onClick}
    >
      <ArrowForwardIcon style={{ fontSize: "2rem" }} />
    </div>
  );
}

function SamplePrevArrow(props) {
  const { className, style, onClick } = props;
  return (
    <div
      style={{
        ...style,
        top: "40%",
        left: "-5px",
        zIndex: "2",
        backgroundColor: "#fff",
        cursor: "pointer",
        height: "32px",
        border: "2px solid #e1e1e1",
        padding: "2px",
        borderRadius: "50%",
        position: "absolute",
      }}
      onClick={onClick}
    >
      <ArrowBackIcon style={{ fontSize: "2rem" }} />
    </div>
  );
}

const data = [
  {
    id: 1,
    img: "./SectionTenImg1.avif",
  },
  {
    id: 2,
    img: "./SectionTenImg2.avif",
  },
  {
    id: 3,
    img: "./SectionTenImg3.avif",
  },
];

function SectionTen() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />,
    initialSlide: 0,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          infinite: true,
          dots: true,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          initialSlide: 1,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
        },
      },
    ],
  };
  return (
    <div>
      <div className="SectionTen">
        <div className="sec1">
          <div className="col2">
            <h4>The Athenaeum</h4>
            <h1>The warm-up </h1>
            <p>
              In The Athenaeum, our digital reading room: a guide to ensuring a
              healthy complexion through the warmer months.
            </p>
            <a href="" className="btn">
              <p>Read more</p>
              <ArrowForwardIcon />
            </a>
          </div>
        </div>
        <div className="sec2">
          <Slider {...settings}>
            <div className="col3">
              {data.map((x) => {
                return (
                  <div style={{display:"flex", flexDirection:"row"}}>
                    <img src={x.img} alt="" />
                  </div>
                );
              })}
            </div>
          </Slider>
        </div>
      </div>
    </div>
  );
}

export default SectionTen;
